import { Routes, Route } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext'; // ðŸ‘ˆ
import User from './User';
import Login from './Login';
import Register from './Register';
import ProfileDetail from './ProfileDetail';
import ProfileCard from './ProfileCard';
import AppLayout from './AppLayout';
import ForgotPassword from './ForgotPassword';
import AdminDashboard from './AdminDashboard';
import MessagingLanding from './MessagingLanding';
import ContactUs from './ContactUs';
import Home from './Home';
import SettingsPage from './SettingsPage';
import ProtectedRoute from '../components/ProtectedRoute';
import Profile from './Profile'; // ðŸ‘ˆ Import the Profile component

const user = {
  name: 'John Doe',
  status: 'Independent Worker',
  image: '/profile.jpg',
};

const AppRoutes = () => {
  const { isLoggedIn } = useAuth();

  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />
      <Route path="/forgot-password" element={<ForgotPassword />} />
      
      <Route
        element={
          <ProtectedRoute>
            <AppLayout isLoggedIn={isLoggedIn} />
          </ProtectedRoute>
        }
      >
        <Route path="/admin-dashboard" element={<AdminDashboard />} />
        <Route path="/user" element={<User />} />
        <Route path="/profile/:userId" element={<Profile />} />
        <Route path="/profile-detail/:id" element={<ProfileDetail />} />
        <Route path="/MessagingLanding" element={<MessagingLanding />} />
        <Route path="/contact" element={<ContactUs />} />
        <Route path="/settings" element={<SettingsPage />} />
      </Route>
    </Routes>
  );
};

export default AppRoutes;
